import { useState } from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';
import TabPanel from './TabPanel';
import PriceTable from './NFTs/PriceTable';
import Sales from './Sales/Sales';
import Metamon from './Metamon/Metamon'
import Elemon from './Elemon/Elemon'
import { Link, Route, Routes } from 'react-router-dom';
import { Switch } from '@mui/material';
import '../App.css'

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}

function Router(props) {
    const { children } = props;
    if (typeof window === 'undefined') {
        return <StaticRouter location="/drafts">{children}</StaticRouter>;
    }

    return (
        <MemoryRouter initialEntries={['/trash']} initialIndex={0}>
            {children}
        </MemoryRouter>
    );
}

const HeaderTabs = () => {

    return (
        <Router>
            <Box sx={{ width: '100%' }}>
                <Box id="tabs" sx={{ borderBottom: 1, borderColor: 'divider' }}>
                    <Tabs sx={{ color: '#ffffff' }} aria-label="basic tabs example">
                        <Tab to='/nfts' value='/nfts' label="NFTs" {...a11yProps(0)} component={Link} />
                        <Tab to='/sales' value='/sales' label="Sales" {...a11yProps(1)} component={Link} />
                        <Tab to='/metamon' value='/metamon' label="Metamon" {...a11yProps(2)} component={Link} />
                        <Tab to='/elemon' value='/elemon' label="Elemon" {...a11yProps(3)} component={Link} />
                    </Tabs>
                </Box>
                {/* <Switch>
                    <Route path='/nfts' element={
                        <TabPanel index={`/nfts`}>
                            <PriceTable />
                        </TabPanel>
                    }>
                    </Route>

                    <TabPanel index={`/sales`}>
                        <Sales />
                    </TabPanel>
                    <TabPanel index={`/metamon`}>
                        <Metamon />
                    </TabPanel>
                    <TabPanel index={`/elemon`}>
                        <Elemon />
                    </TabPanel>
                </Switch> */}

            </Box>
        </Router>

    );
}

export default HeaderTabs;
